// Ejemplo de cdigo para crear una sesin de verificacin
const createIdentityVerificationSession = async () => {
  try {
    const response = await fetch('https://notarypro.cl/api/identity-api/create-session', {
      method: 'POST',
      headers: {
        'Authorization': 'Bearer YOUR_API_KEY',
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({
        callbackUrl: '${n}',
        userData: {
          // Datos opcionales del usuario para personalizar la experiencia
          name: 'Juan Prez',
          email: 'juan@ejemplo.cl',
          // Cualquier dato adicional que necesites para tu aplicacin
        },
        requiredVerifications: ['document', 'facial', 'nfc'], // Verificaciones requeridas
        customBranding: {
          // Opcional: Personalizacin de marca
          logo: 'https://tu-aplicacion.cl/logo.png',
          primaryColor: '#FF0000',
          secondaryColor: '#000000'
        }
      })
    });

    const data = await response.json();
    
    if (data.success) {
      // Redirigir al usuario a la URL de verificacin
      window.location.href = data.data.verificationUrl;
      // O mostrar un enlace para que el usuario pueda acceder a la verificacin
      // setVerificationUrl(data.data.verificationUrl);
    } else {
      console.error('Error:', data.error);
    }
  } catch (error) {
    console.error('Error creating verification session:', error);
  }
};
